import React from 'react';
import TableWrapper from '../AntTables.styles';
import services from '../../services';
import { Table } from 'antd';
export default function() {
  const columns = [
    {
      title: 'Tên dịch vụ',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Giá',
      dataIndex: 'price',
      key: 'price',
    },
    {
      title: 'Giá ưu đãi',
      dataIndex: 'price-discount',
      key: 'address',
    },
    {
      title: 'Mô tả',
      dataIndex: 'description',
      key: 'address',
    },
    {
      title: 'Hình ảnh',
      dataIndex: 'picture',
      key: 'address',
    },
    {
      title: 'Thời gian thực hiện',
      dataIndex: 'time_estimate',
      key: 'address',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },

  ];
  const SortableContainer = sortableContainer(props => <tbody {...props} />);
  DraggableContainer = props => (
    <SortableContainer
      useDragHandle
      disableAutoscroll
      helperClass="row-dragging"
      onSortEnd={this.onSortEnd}
      {...props}
    />
  );
  return (
    <Table dataSource={services.data.data} columns={columns} components={{
      body: {
        wrapper: this.DraggableContainer,
        row: this.DraggableBodyRow,
      },
    }} />
  );
}
